#批量数据插入case
def ins_manay(project_id, case_name, api_id, num, req_data):
    # uid = uuid.uuid4()
    creattime = int(round(time.time() * 1000))
    # insert_sql = "INSERT INTO `metersphere`.`api_test_case` (`id`, `project_id`, `name`, `priority`, `api_definition_id`, `create_time`, `update_time`, `version`, `order`) VALUES (%s, '123', 'sdas', 'P0', '123', 1645517968577, 1645517968577, 0, 30000)"
    insert_sql = """INSERT INTO `metersphere`.`api_test_case` (`id`, `project_id`, `name`, `priority`, `api_definition_id`, `description`, `request`, `create_user_id`, `update_user_id`, `create_time`, `update_time`, `num`, `tags`, `last_result_id`, `status`, `original_status`, `delete_time`, `delete_user_id`, `version`, `order`, `case_status`, `version_id`) 
    VALUES (%s, %s, %s, 'P1', %s, %s, %s, 'qingmu', 'qingmu', %s, %s, %s, '', NULL, '', NULL, NULL, NULL, 0, %s, 'Underway', '3b984545-8aeb-11ec-afc3-0242ac1e0a02')
    """
    rq = time.strftime("%m%d", time.localtime())
    params = ((uuid.uuid4(), project_id, case_name+'_'+rq+'_'+str(i), api_id, 'autocase', req_data[i], creattime, creattime, num+str(i), str(1000+i*50)) for i in range(0, len(req_data)))
    ms.insert_many(insert_sql, params)
    # print('======插入用例完成======')


def query_by_sql(project_id, api_name):
    #sql = "select id, project_id, name, request,response,version_id from api_definition where name = '企业分支机构'"
    if api_name:
        # print(1111)
        sql = "select id, project_id, name, path, method, request,response,version_id from api_definition where project_id = '%s' and name = '%s' and status != 'Trash' and protocol = 'HTTP'" % (project_id, api_name)
    else:
        # print(22222)
        sql = "select id, project_id, name, path, method, request,response,version_id from api_definition where project_id = '%s' and status != 'Trash' and protocol = 'HTTP'" % project_id
    #sql = "select id, project_id, name, request,response,version_id from api_definition where name = '广发登录'"
    #sql = "select id, project_id, name, request,response,version_id from api_definition where project_id = '3d142ad6-c0d5-492c-9fb2-360970a99bb5' and create_time < 1636095101396"
    # print(ms.fetch_all(sql))
    resp = ms.fetch_all(sql)
    return resp


def delete_by_sql(project_id, api_name):
    if api_name:
        args = '%' + api_name + '%'
        sql = "DELETE from  api_test_case where description = 'autocase' and project_id = '%s' and name like '%s'" % (project_id, args)
    else:
        sql = "DELETE from  api_test_case where description = 'autocase' and project_id = '%s'" % project_id
    resp = ms.delete(sql)
    return resp

def query_project():
    sql = "select id, name from project where description like '%autocase%'"
    resp = ms.fetch_all(sql)
    return resp

def query_args(projectID):
    sql = "select a.id, a.name as api_name, a.path, a.request, a.response, a.method, b.name as project_name FROM api_definition a LEFT JOIN project b on a.project_id = b.id where a.project_id = '%s' and a.status != 'Trash' and protocol = 'HTTP'" % projectID
    # print(sql)
    resp = ms.fetch_all(sql)
    return resp

def query_project_id():
    sql = "select a.name as api_name, b.id from api_definition a left join project b on a.project_id = b.id where a.status != 'Trash' and a.protocol = 'HTTP' and b.description like '%autocase%' "
    resp = ms.fetch_all(sql)
    return resp

def query_swagger_url(projectID):
    sql = "select swagger_url from swagger_url_project where project_id = '%s'" % projectID
    resp = ms.fetch_all(sql)
    return resp

def delete_api_by_url(path, method):
    sql = "delete from api_definition where path = '%s' and method = '%s'" % (path, method)
    resp = ms.delete(sql)
    return resp

